#include <stdio.h>
#include <stdlib.h>

typedef struct Node {
    int key;
    struct Node* prev;
    struct Node* next;
} Node;

typedef struct {
    Node* head;
    Node* tail;
} DoublyLinkedList;

DoublyLinkedList* createDoublyLinkedList() {
    DoublyLinkedList* dll = (DoublyLinkedList*)malloc(sizeof(DoublyLinkedList));
    dll->head = NULL;
    dll->tail = NULL;
    return dll;
}

void insert(DoublyLinkedList* dll, int key) {
    Node* newNode = (Node*)malloc(sizeof(Node));
    newNode->key = key;
    newNode->prev = NULL;
    newNode->next = dll->head;
    if (dll->head != NULL) {
        dll->head->prev = newNode;
    }
    dll->head = newNode;
    if (dll->tail == NULL) {
        dll->tail = newNode;
    }
}

void delete(DoublyLinkedList* dll, int key) {
    Node* current = dll->head;
    while (current != NULL) {
        if (current->key == key) {
            if (current->prev != NULL) {
                current->prev->next = current->next;
            } else {
                dll->head = current->next;
            }
            if (current->next != NULL) {
                current->next->prev = current->prev;
            } else {
                dll->tail = current->prev;
            }
            free(current);
            return;
        }
        current = current->next;
    }
}

void deleteFirst(DoublyLinkedList* dll) {
    if (dll->head != NULL) {
        Node* temp = dll->head;
        dll->head = dll->head->next;
        if (dll->head != NULL) {
            dll->head->prev = NULL;
        } else {
            dll->tail = NULL;
        }
        free(temp);
    }
}

void deleteLast(DoublyLinkedList* dll) {
    if (dll->tail != NULL) {
        Node* current = dll->head;
        while (current->next != NULL) {
            current = current->next;
        }
        if (current->prev != NULL) {
            current->prev->next = NULL;
        } else {
            dll->head = NULL;
        }
        dll->tail = current->prev;
        free(current);
    }
}

void printList(DoublyLinkedList* dll) {
    Node* current = dll->head;
    while (current != NULL) {
        printf("%d ", current->key);
        current = current->next;
    }
    printf("\n");
}

