        } else if (strcmp(command, "delete") == 0) {
            delete(dll, key);
        } else if (strcmp(command, "deleteFirst") == 0) {
            deleteFirst(dll);
        } else if (strcmp(command, "deleteLast") == 0) {
            deleteLast(dll);
        }
    }
    printList(dll);
    return 0;
}
